mfunnet i Vassenden.</blockquote>\n\nSom ny WordPress-bruker burde du gå til ditt <a href=\"http://badderen.no/wp-admin/\">kontrollpanel</a> for å slette denne siden og lage nye sider for ditt innhold. Lykke til!', 'Testside', '', 'publish', 'closed', 'open', '', 'testside', '', '', '2015-09-23 14:52:55', '2015-09-23 12:52:55', '', '0', 'http://badderen.no/?page_id=2', '0', 'page', '', '0' ); ";i:299;s:267:"INSERT INTO wp_posts VALUES( '38', '1', '2015-10-06 19:01:01', '0000-00-00 00:00:00', '', 'Automatisk kladd', '', 'auto-draft', 'open', 'open', '', '', '', '', '2015-10-06 19:01:01', '0000-00-00 00:00:00', '', '0', 'http://badderen.no/?p=38', '0', 'post', '', '0' ); ";i:300;s:268:"INSERT INTO wp_posts VALUES( '4', '1', '2015-09-23 15:15:42', '2015-09-23 13:15:42', '', 'Viking', '', 'publish', 'closed', 'closed', '', 'viking', '', '', '2015-10-06 19:42:41', '2015-10-06 17:42:41', '', '0', 'http://badderen.no/?page_id=4', '0', 'page', '', '0' ); ";i:301;s:294:"INSERT INTO wp_posts VALUES( '5', '1', '2015-09-23 15:15:42', '2015-09-23 13:15:42', '', 'Viking', '', 'inherit', 'closed', 'closed', '', '4-revision-v1', '', '', '2015-09-23 15:15:42', '2015-09-23 13:15:42', '', '4', 'http://badderen.no/2015/09/23/4-revision-v1/', '0', 'revision', '', '0' ); ";i:302;s:268:"INSERT INTO wp_posts VALUES( '6', '1', '2015-09-23 15:16:16', '2015-09-23 13:16:16', '', 'Utleie', '', 'publish', 'closed', 'closed', '', 'utleie', '', '', '2015-09-23 15:16:16', '2015-09-23 13:16:16', '', '0', 'http://badderen.no/?page_id=6', '0', 'page', '', '0' ); ";i:303;s:294:"INSERT INTO wp_posts VALUES( '7', '1', '2015-09-23 15:16:16', '2015-09-23 13:16:16', '', 'Utleie', '', 'inherit', 'closed', 'closed', '', '6-revision-v1', '', '', '2015-09-23 15:16:16', '2015-09-23 13:16:16', '', '6', 'http://badderen.no/2015/09/23/6-revision-v1/', '0', 'revision', '', '0' ); ";i:304;s:1577:"INSERT INTO wp_posts VALUES( '8', '1', '2015-09-23 15:16:29', '2015-09-23 13:16:29', '<div id=\"main_box\">\r\n<div id=\"main_text\">\r\n<h2>Mekonomen Bilverksteder</h2>\r\nhar kunnskap og utstyr til å kunne utføre de fleste bilreparasjoner.\r\n\r\n</div>\r\n</div>\r\n<div id=\"left_column\">\r\n\r\nVi har bl.a. tilgang til Mekotech Plus, Mekonomens eget tekniske oppslagsverk, med informasjon om bilenes elektroniske systemer, serviceintervaller og -omfang, monteringsanvisninger for kamreimskift og mye mer.\r\n\r\nVi benytter også Mekotech Diagnose, et av markedets mest komplette og avanserte system for diagnose og feilsøking i moderne bilelektronikk.\r\n\r\nAvhengig av bilmodell kan vi feilsøke motorstyringen, ABS, SRS, klimaanlegg, automatgirkasser, kjøresperre etc.\r\n\r\n</div>\r\n<div id=\"center_column\">\r\n\r\nVi videreutdanner oss også løpende og har tilgang til Mekotech Support, hvor vi kan innhente informasjon som måtte mangle i det lokale verkstedet.\r\n\r\nDen elektroniske delekatalogen Mekotech Sys og administrasjonsprogrammet Mekotech Office er ytterlig to programmer som vi tilbyr verkstedene.\r\n\r\nDisse gir verkstedet anledning til å gi deg et raskt og oversiktlig tilbud, basert på bilens registreringsnummer, inkluderende arbeid og deler. Det samme utstyret benyttes også for å bestille deler i den lokale Mekonomen Butikken.\r\n\r\n</div>', 'Mekonomen', '', 'publish', 'closed', 'closed', '', 'mekonomen', '', '', '2015-09-24 10:03:04', '2015-09-24 08:03:04', '', '0', 'http://badderen.no/?page_id=8', '0', 'page', '', '0' ); ";i:305;s:297:"INSERT INTO wp_posts VALUES( '9', '1', '2015-09-23 15:16:29', '2015-09-23 13:16:29', '', 'Mekonomen', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2015-09-23 15:16:29', '2015-09-23 13:16:29', '', '8', 'http://badderen.no/2015/09/23/8-revision-v1/', '0', 'revision', '', '0' ); ";i:306;s:3109:"INSERT INTO wp_posts VALUES( '10', '1', '2015-09-23 15:21:02', '2015-09-23 13:21:02', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus et euismod risus. Etiam eleifend, lectus non cursus ultricies, ex enim finib