6:22', ' ', '', '', 'publish', 'closed', 'closed', '', '28', '', '', '2015-09-24 09:46:22', '2015-09-24 07:46:22', '', '0', 'http://badderen.no/?p=28', '5', 'nav_menu_item', '', '0' ); ";i:325;s:322:"INSERT INTO wp_posts VALUES( '29', '1', '2015-09-24 09:58:07', '2015-09-24 07:58:07', '', 'profil-gul', '', 'inherit', 'open', 'closed', '', 'profil-gul', '', '', '2015-09-24 09:58:07', '2015-09-24 07:58:07', '', '8', 'http://badderen.no/wp-content/uploads/2015/09/profil-gul.jpg', '0', 'attachment', 'image/jpeg', '0' ); ";i:326;s:316:"INSERT INTO wp_posts VALUES( '30', '1', '2015-09-24 10:01:59', '2015-09-24 08:01:59', '', 'banner-3', '', 'inherit', 'open', 'closed', '', 'banner-3', '', '', '2015-09-24 10:01:59', '2015-09-24 08:01:59', '', '8', 'http://badderen.no/wp-content/uploads/2015/09/banner-3.jpg', '0', 'attachment', 'image/jpeg', '0' ); ";i:327;s:1553:"INSERT INTO wp_posts VALUES( '31', '1', '2015-09-24 10:02:37', '2015-09-24 08:02:37', '<div id=\"main_box\">\n<div id=\"main_text\">\n<h2>Mekonomen Bilverksteder</h2>\nhar kunnskap og utstyr til å kunne utføre de fleste bilreparasjoner.\n\n</div>\n</div>\n<div id=\"left_column\">\n\nVi har bl.a. tilgang til Mekotech Plus, Mekonomens eget tekniske oppslagsverk, med informasjon om bilenes elektroniske systemer, serviceintervaller og -omfang, monteringsanvisninger for kamreimskift og mye mer.\n\nVi benytter også Mekotech Diagnose, et av markedets mest komplette og avanserte system for diagnose og feilsøking i moderne bilelektronikk.\n\nAvhengig av bilmodell kan vi feilsøke motorstyringen, ABS, SRS, klimaanlegg, automatgirkasser, kjøresperre etc.\n\n</div>\n<div id=\"center_column\">\n\nVi videreutdanner oss også løpende og har tilgang til Mekotech Support, hvor vi kan innhente informasjon som måtte mangle i det lokale verkstedet.\n\nDen elektroniske delekatalogen Mekotech Sys og administrasjonsprogrammet Mekotech Office er ytterlig to programmer som vi tilbyr verkstedene.\n\nDisse gir verkstedet anledning til å gi deg et raskt og oversiktlig tilbud, basert på bilens registreringsnummer, inkluderende arbeid og deler. Det samme utstyret benyttes også for å bestille deler i den lokale Mekonomen Butikken.\n\n</div>', 'Mekonomen', '', 'inherit', 'closed', 'closed', '', '8-autosave-v1', '', '', '2015-09-24 10:02:37', '2015-09-24 08:02:37', '', '8', 'http://badderen.no/2015/09/24/8-autosave-v1/', '0', 'revision', '', '0' ); ";i:328;s:1601:"INSERT INTO wp_posts VALUES( '32', '1', '2015-09-24 10:03:04', '2015-09-24 08:03:04', '<div id=\"main_box\">\r\n<div id=\"main_text\">\r\n<h2>Mekonomen Bilverksteder</h2>\r\nhar kunnskap og utstyr til å kunne utføre de fleste bilreparasjoner.\r\n\r\n</div>\r\n</div>\r\n<div id=\"left_column\">\r\n\r\nVi har bl.a. tilgang til Mekotech Plus, Mekonomens eget tekniske oppslagsverk, med informasjon om bilenes elektroniske systemer, serviceintervaller og -omfang, monteringsanvisninger for kamreimskift og mye mer.\r\n\r\nVi benytter også Mekotech Diagnose, et av markedets mest komplette og avanserte system for diagnose og feilsøking i moderne bilelektronikk.\r\n\r\nAvhengig av bilmodell kan vi feilsøke motorstyringen, ABS, SRS, klimaanlegg, automatgirkasser, kjøresperre etc.\r\n\r\n</div>\r\n<div id=\"center_column\">\r\n\r\nVi videreutdanner oss også løpende og har tilgang til Mekotech Support, hvor vi kan innhente informasjon som måtte mangle i det lokale verkstedet.\r\n\r\nDen elektroniske delekatalogen Mekotech Sys og administrasjonsprogrammet Mekotech Office er ytterlig to programmer som vi tilbyr verkstedene.\r\n\r\nDisse gir verkstedet anledning til å gi deg et raskt og oversiktlig tilbud, basert på bilens registreringsnummer, inkluderende arbeid og deler. Det samme utstyret benyttes også for å bestille deler i den lokale Mekonomen Butikken.\r\n\r\n</div>', 'Mekonomen', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2015-09-24 10:03:04', '2015-09-24 08:03:04', '', '8', 'http://badderen.no/2015/09/24/8-revision-v1/', '0', 'revision', '', '0' ); ";i:329;s:1047:"INSERT INTO wp_posts VALUES( '33', '1', '2015-09-24 10:26:25', '2015-09-24 08:26:25', '<div id=\"main_box\">\r\n<div id=\"main_text\">\r\n\r\nVi er forhandler i Kvænangen Kommune for AGA propan.\r\n\r\n</div>\r\n</div>\r\n<div id=\"left_column\">\r\n\r\nAGA er landets største leverandør av gasser til forskjellig bruk i samfunnet og er den leverandøren med flest utsalgssteder i Norge.\r\n\r\nMeget gode priser på Propan 10 og 11 Kgs flasker.\r\n\r\n</div>\r\n<div id=\"center_column\">\r\n\r\nSe de spesielt gunstige betingelser for medlemmer av Norsk Caravan Club - <a href=\"http://www.aga.no/international/web/lg/no/like35agano.nsf/docbyalias/nav_camping\" target=\"_new\">hver 4. propanfylling gratis</a>. Rabattordningen registreres i et stemplingskort som du får fra NCC. Ved kjøp av ny propanbeholder gis to stempler i kortet.\r\n\r\n</div>', 'AGA Propan', '', 'publish', 'closed', 'closed', '', 'aga-propan', '', '', '2015-09-24 10:29:03', '2015-09-24 08:29:03', '', '0', 'http://badderen.no/?page_id=33', '0', 'page', '', '0' ); ";i:330;s:1090:"INSERT INTO wp_posts VALUES( '34', '1', '2015-09-24 10:26:25', '2015-09-24 08:26:25', '<div id=\"main_box\">\r\n<div id=\"main_text\">\r\n<h2>AGA Propan</h2>\r\nVi er forhandler i Kvænangen Kommune for AGA propan.\r\n\r\n</div>\r\n</div>\r\n<div id=\"left_column\">\r\n\r\nAGA er landets største leverandør av gasser til forskjellig bruk i samfunnet og er den leverandøren med flest utsalgssteder i Norge.\r\n\r\nMeget gode priser på Propan 10 og 11 Kgs flasker.\r\n\r\n</div>\r\n<div id=\"center_column\">\r\n\r\nSe de spesielt gunstige betingelser for medlemmer av Norsk Caravan Club - <a href=\"http://www.aga.no/international/web/lg/no/like35agano.nsf/docbyalias/nav_camping\" target=\"_new\">hver 4. propanfylling gratis</a>. Rabattordningen registreres i et stemplingskort som du får fra NCC. Ved kjøp av ny propanbeholder gis to stempler i kortet.\r\n\r\n</div>', 'AGA Propan', '', 'inherit', 'closed', 'clos