, side- eller bakrute.</p>\r\n\r\n</div>\r\n<div id=\"center_column\">\r\n<p style=\"text-align: justify;\">RIIS BILGLASS kan reparere/skifte glass på alle bilmerker/modeller som i dag kjører på norske veier.</p>\r\n<p style=\"text-align: justify;\">Vi har gjennom vårt nett av leverandører tilgang på bilruter fra ledende produsenter og grossister i hele Europa.</p>\r\n<p style=\"text-align: justify;\">Videre vil din garanti for et førsteklasses arbeid og produkt bestå i den sikkerhet som ligger i verkstedenes solidariske ansvar for arbeidet.</p>\r\n<p style=\"text-align: justify;\">Vi tilbyr leiebil ved frontruteskiftskift, vår mann har flere års erfaring innen dette faget og har fagbrev innen området.</p>\r\n\r\n</div>', 'Frontruteskift', '', 'publish', 'closed', 'closed', '', 'frontruteskift', '', '', '2015-10-06 20:44:57', '2015-10-06 18:44:57', '', '0', 'http://badderen.no/?page_id=56', '0', 'page', '', '0' ); ";i:344;s:1511:"INSERT INTO wp_posts VALUES( '57', '1', '2015-10-06 20:29:17', '2015-10-06 18:29:17', '<div id=\"left_column\">\r\n\r\nNorske veier er hensynsløse. Det er fort gjort å få bilrutene skadet av steinsprut, men heldigvis er det fort gjort å fikse glasset også. De fleste skader reparerer vi mens du tar en kopp kaffe. Har du kasko eller delkasko på bilen din, koster ikke reparasjonen deg noen ting. Er skaden så omfattende at ruta må skiftes, betaler du kun den egenandelen som er fastsatt av forsikringsselskapet ditt.\r\n\r\nGjennom å velge et RIIS BILGLASS-verksted er du garantert et høyverdig håndverksmessig utført arbeid på bilen din, enten det er skifting eller reparering av front-, side- eller bakrute.\r\n\r\n</div>\r\n<div id=\"center_column\">\r\n\r\nRIIS BILGLASS kan reparere/skifte glass på alle bilmerker/modeller som i dag kjører på norske veier.\r\n\r\nVi har gjennom vårt nett av leverandører tilgang på bilruter fra ledende produsenter og grossister i hele Europa.\r\n\r\nVidere vil din garanti for et førsteklasses arbeid og produkt best